/**
 * Esta función permite obtener los datos de Catastro de acuerdo a los parámetros indicados
 * 
 * Ej.: getDataCatastro('Estado', 'estado_id', '21', false);
 * 
 * @param {String} entidad Nombre de la entidad que se va a consultar ('Estado', 'Municipio', 'Parroquia').
 * @param {String} campo Nombre del Campo por el cual se va a filtrar la data ('id', 'region_id', 'estado_id', 'municipio_id').
 * @param {Integer|String|Array} valor Valor que debe tener el campo para filtrar la data.
 * @param {Boolean} inverso indica si debe ser igual (false) o distinto (true) el valor a comparar 
 */
function getDataCatastro(entidad, campo, valor, inverso, orderBy){
    
    if(orderBy===undefined || orderBy==null){
        orderBy = "nombre";
    }

    var response = [];
    var arrayData = [];
    var jsonData = {};
    var i = 0;

    // console.log($.inArray(entidad, ["Estado", "Municipio", "Parroquia"])!==-1);

    if($.inArray(entidad, ["Estado", "Municipio", "Parroquia"])!==-1){
        
        // console.log("Entidad Valida: "+entidad);
        
        if(entidad=="Estado"){
            arrayData = getEstadosCatastro();
        }
        else if(entidad=="Municipio"){
            arrayData = getMunicipiosCatastro();
        }
        else if(entidad=="Parroquia"){
            arrayData = getParroquiasCatastro();
        }
        
        // console.log(arrayData);
        
        if(valor===undefined || campo==undefined || valor === null || valor.length===0 || campo === null || campo.length===0){
            response = arrayData;
        }
        else{
            if(campo in arrayData[0]){
                for(i=0;i<arrayData.length;i++){
                    jsonData = arrayData[i];
                    if(filterDataCatatro(jsonData, campo, valor, inverso)){
                        response.push(jsonData);
                    }
                }            
            }
            else{
                console.log("El campo indicado para efectuar el filtro de datos no se encuentra presente en el arreglo de datos.");
                response = arrayData;
            }
        }
    }
    
    return response.sort(predicatBy(orderBy));;
}

function filterDataCatatro(data, field, value, inverse){

    var response = false;
    if(inverse){
        if(Array.isArray(value)){
            response = !(data[field] in value);
        }
        else{
            response = !(data[field]==value);
        }
    }
    else{
        if(Array.isArray(value)){
            response = (data[field] in value);
        }
        else{
            response = (data[field]==value);
        }
    }
    return response;
}

/**
 * retorna un String que contiene las etiquetas option html según un arreglo de objetos json
 * 
 * @param {Array[json]} data Arreglo de datos json
 * @param {String} labelAttr Atributo que representará la etiqueta del option vista por el usuario
 * @param {String} valueAttr Atributo que representará el valor del option
 * @param {String} selectedValue Valor que debe ser seleccionado
 * @returns {String}
 */
function generateOptionsToSelect(data, labelAttr, valueAttr, selectedValue){
    var response = "<option value=''>- - -</option>";
    var datoInicial = data[0];
    try {
        if(data.length>0){
            if(Array.isArray(data) && (labelAttr in datoInicial) && (valueAttr in datoInicial)){
                var i = 0;
                var jsonData = {};
                for(i=0;i<data.length;i++){
                    jsonData = data[i];
                    if(selectedValue!==undefined && selectedValue==jsonData[valueAttr]){
                        response += "<option value='"+jsonData[valueAttr]+"' selected>"+jsonData[labelAttr]+"</option>";
                    }else{
                        response += "<option value='"+jsonData[valueAttr]+"'>"+jsonData[labelAttr]+"</option>";
                    }
                }
            }
        }
    }catch (e){
        console.log(e);
    }
    return response;
}
